import React, { PropTypes } from 'react'

const bgImage = (props) => {
    return <div style={{ backgroundImage: `url(./images/${props.imageName}.png` }} />
  }

bgImage.propTypes = {
    imageName: PropTypes.string
  };

export default bgImage;
